import React from 'react';
import { motion } from 'framer-motion';
import { 
  MapPin, 
  Star, 
  BarChart3, 
  Link, 
  FileText, 
  TrendingUp,
  CheckCircle
} from 'lucide-react';

const Services = () => {
  const services = [
    {
      icon: MapPin,
      title: 'Google Business Profile Optimization',
      description: 'Complete setup and optimization of your Google Business Profile to improve local visibility and attract more customers.',
      features: ['Profile completion', 'Category optimization', 'Photo optimization', 'Regular updates']
    },
    {
      icon: Star,
      title: 'Review Generation & Management',
      description: 'Strategic review generation campaigns and ongoing management to build trust and improve local rankings.',
      features: ['Review generation strategy', 'Response management', 'Review monitoring', 'Reputation building']
    },
    {
      icon: BarChart3,
      title: 'Geo-Tagged Maps Creation',
      description: 'Custom Google Maps with geo-tagged locations to enhance local SEO and improve map pack visibility.',
      features: ['Custom map creation', 'Location optimization', 'Local keyword targeting', 'Map pack optimization']
    },
    {
      icon: Link,
      title: 'Citation & Backlink Building',
      description: 'Comprehensive citation building and high-quality backlink acquisition to strengthen your local authority.',
      features: ['NAP consistency', 'Directory submissions', 'Local backlinks', 'Citation cleanup']
    },
    {
      icon: FileText,
      title: 'Monthly Reporting Dashboard',
      description: 'Detailed monthly reports showing your progress, rankings, and ROI with actionable insights.',
      features: ['Ranking tracking', 'Call tracking', 'ROI analysis', 'Competitive analysis']
    },
    {
      icon: TrendingUp,
      title: 'Local SEO Strategy',
      description: 'Comprehensive local SEO strategy tailored to your business and target market for maximum results.',
      features: ['Keyword research', 'Competitor analysis', 'Content strategy', 'Technical optimization']
    },
    {
      icon: Rocket,
      title: 'Google Maps PowerBoost ðŸš€',
      description: 'Advanced Google Business Profile (GMB/GBP) strategy to help you rank in the Map Pack and dominate your local area.',
      features: [
        '300 Local Geotagged Google Map Points',
        '15â€“45 mile radius maps + 5-mile bonus radius',
        '20 driving direction paths embedded',
        '10 Geotagged images inside Google MyMaps',
        'NAP embedded, Video + Photo Stacking',
        '99 High DA backlinks with CID link indexing',
        '30-Day Drip Feed & SEO Recommendations'
      ],
      price: '$347',
      priceType: 'One-time optimization',
      cta: 'Boost My Local Ranking',
      isPremium: true
    }
  ];

  return (
    <section id="services" className="section-padding bg-gray-50">
      <div className="container-custom">
        {/* Section Header */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl font-bold text-gray-900 mb-4">
            What We Do
          </h2>
          <p className="text-xl text-gray-600 max-w-3xl mx-auto">
            Our comprehensive local SEO services are designed to get your business found by the right customers at the right time.
          </p>
        </motion.div>

        {/* Services Grid */}
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
          {services.map((service, index) => (
            <motion.div
              key={service.title}
              initial={{ opacity: 0, y: 30 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: index * 0.1 }}
              viewport={{ once: true }}
              whileHover={{ y: -5 }}
              className="card p-8 group"
            >
              {/* Icon */}
              <div className="w-16 h-16 bg-gradient-to-br from-primary-500 to-orange-500 rounded-xl flex items-center justify-center mb-6 group-hover:scale-110 transition-transform duration-300">
                <service.icon className="w-8 h-8 text-white" />
              </div>

              {/* Title */}
              <h3 className="text-xl font-bold text-gray-900 mb-4">
                {service.title}
              </h3>

              {/* Description */}
              <p className="text-gray-600 mb-6 leading-relaxed">
                {service.description}
              </p>

              {/* Features */}
              <ul className="space-y-2">
                {service.features.map((feature) => (
                  <li key={feature} className="flex items-center text-sm text-gray-600">
                    <CheckCircle className="w-4 h-4 text-green-500 mr-3 flex-shrink-0" />
                    {feature}
                  </li>
                ))}
              </ul>
            </motion.div>
          ))}
        </div>

        {/* CTA Section */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="text-center mt-16"
        >
          <div className="bg-white rounded-2xl p-8 shadow-lg border border-gray-100 max-w-2xl mx-auto">
            <h3 className="text-2xl font-bold text-gray-900 mb-4">
              Ready to Dominate Local Search?
            </h3>
            <p className="text-gray-600 mb-6">
              Get a free local SEO audit and discover how we can help your business get found by more local customers.
            </p>
            <motion.button
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
              className="btn-primary"
            >
              Get Your Free Audit
            </motion.button>
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default Services;
